import React from 'react';
import { StyleSheet, View, Text, Button } from 'react-native';

function TodoScreen({ goBack }: { goBack():void }) {

  return (
    <View>
      <Text>TodoScreen</Text>
      <Button 
        title='Назад'
        onPress={goBack}
      />
    </View>
  )
}

const styles = StyleSheet.create({

});

export default TodoScreen;
